                list.Add(string.Format("A x Yt x Yt = {0:f4} x {1:f4} x {1:f4} = {2:f4}", A8[c], Yt8[c], A_Yt8[c]));


                Iself8[c] = (A8[c] * Math.Pow(Section_Ts[c], 2)) / 12.0;
