                list.Add(string.Format("           = ({0:f4} x {1:f4}^2) / 12", A8[c], Section_Ts[c]));
                list.Add(string.Format("           = {0:f6}", Iself8[c]));
                list.Add(string.Format(""));

                Iself_A_Yt_Yt8[c] = Iself8[c] + A_YT_Yt8[c];
