                Iyy8[c] = (Section_Ts[c] * Math.Pow((Section_SW[c] - 2 * Section_K1[c]), 3)) / 12.0;

                list.Add(string.Format("I(yy)   = (Ts x (Sw - 2 x K1)^3) / 12"));
                list.Add(string.Format("        = {0:f4} x ({1:f4} - 2 x {2:f4})^3 / 12", Section_Ts[c], Section_SW[c], Section_K1[c]));
