                list.Add(string.Format("Iself (xx) = Moment of Inertia "));
                list.Add(string.Format("           = (K2 x Ts^3) / 18"));
                list.Add(string.Format("           = ({0:f4} x {1:f4}^3) / 18", Section_K2[c], Section_Ts[c]));
