                Iyy11[c] = (Section_HH3[c] * Math.Pow(Section_HW3[c], 3) / 18) +
                           A11[c] * Math.Pow((Section_SW[c] / 2 - Section_K1[c] + Section_K2[c] - Section_Tw[c] / Math.Cos(theta[c]) - Section_HW3[c] / 3), 2);


